@AgoneyB @RTVCes @NacCanariaTw Fijate que siendo yo majorera no conozco ni uno. Pero esa no es la cuestion. 

Tenemos un lenguaje muy rico y variado y cada isla cuenta con sus propios usos y costumbres del mismo. 

Nadie en Fuerteventura entenderia esta noticia si hablasemos de la 'playa  de las cotufas'
